) Given the above, the following guidelines should be considered when the env.py script calls upon MigrationContext.run_migrations() multiple times when running autogenerate: If the process_revision_directives hook aims to add elements based on inspection of the current database / connection , it should do its operation on each iteration. This is so that each time the hook runs, the database is available. Alternatively, if the process_revision_directives hook aims to modify the list of migration directives in place , this should be called only on the last iteration. This is so that the hook isn’t being given an ever-growing structure each time which it has already modified previously. The Rewriter object, if used, should be called only on the last iteration , because it will always deliver all directives every time, so again to avoid double/triple/etc. processing of directives it should be called only when the structure is complete. The MigrationScript.upgrade_ops_list and MigrationScript.downgrade_ops_list attributes should be consulted when referring to the collection of UpgradeOps and DowngradeOps objects.

